const Precio = (props) => {

    const {price, percent_change_1h, percent_change_24h, percent_change_7d } = props.precio;

    return(
        <div className="card text-white bg-success mb-3">
            <div className="card-header">
                Precio del Bitcoin
            </div>
            <div className="card-body">
                <h4 className="card-title">Precio Actual : ${price}</h4>
                <div className="d-md-flex justify-content-between">
                    <p className="card-text"><span className="font-weight-bold">Ultima hora: {percent_change_1h}%</span></p>
    <p className="card-text"><span className="font-weight-bold">Ultimas 24 horas: {percent_change_24h}%</span></p>
                    <p className="card-text"><span className="font-weight-bold">Ultimos 7 dias: {percent_change_7d}%</span></p>
                </div>
            </div>
        </div>
    );
}

export default Precio;
